【商品説明】<br>●天然系消臭成分が車内のしみついたニオイを消臭します●超微粒ミストで、空間・シート等にしみついたニオイを消臭します<br>使用方法用途など：<BR>ノズル先端の青いフタを上までカチッと開け、下記の使用目安を参照して使用する。シート、フロアマット等の布製品３０ｃｍ以上離して、１平方メートルあたり２～３回スプレー空間４ドアセダン車で、４～５回スプレーノズル先端の青いフタを必ず閉め、ボトルを立てて保管する。※横向きや逆さまにして使用しない。保管および廃棄方法●保管の際は、直射日光の当たる場所、４０℃以上になる所に置かない。●廃棄の際は、地域の規則に従って廃棄する。<br><br>成分：<BR>消臭剤、抗菌剤、香料<br>使用上の注意：<BR>●走行中は使用しない。●ペダル操作の妨げになるため、運転席の下や足元に置かない。●布製品に直接使う際は、シミの原因となる汚れは予め取り除き、目立たない所で試してから使う。●汚れが原因で輪ジミになる場合がある。●故障や変色の恐れがあるので、布製品以外の内装（電気製品、革、人工皮革、プラスチック等）にかけないように注意する。●万一、布製品以外の内装にかかった際は、速やかに布などで拭き取る。●用途以外には使用しない。●吸入飲用不可：人体に害があるので絶対に飲まない。●人体に向かってスプレーしない。●皮フに触れた場合、かぶれる恐れがあるので注意する。●幼児の手の届く所に置かない。応急処置●万一、飲んだ場合は、直ちに医師の診察を受ける。●誤って目に入った場合や皮フに付着した場合は、直ちに流水で１５分以上洗浄し、異常があれば医師の診察を受ける。●使用中気分が悪くなった場合は、直ちに使用を中止し、気分が回復しない場合は、医師の診察を受ける。<br>商品区分：日用雑貨品・他<br>問い合わせ先：<BR>エステー株式会社　お客様相談室　〒１６１－８５４０　東京都新宿区下落合１－４－１０　０３（３３６７）２１２０<br>原産国：日本<br>商品サイズ：103×177×43<BR><br>JANコード：4901070124916<BR>cs：20<BR><br>使用方法用途など：ノズル先端の青いフタを上までカチッと開け、下記の使用目安を参照して使用する。シート、フロアマット等の布製品３０ｃｍ以上離して、１平方メートルあたり２～３回スプレー空間４ドアセダン車で、４～５回スプレーノズル先端の青いフタを必ず閉め、ボトルを立てて保管する。※横向きや逆さまにして使用しない。保管および廃棄方法●保管の際は、直射日光の当たる場所、４０℃以上になる所に置かない。●廃棄の際は、地域の規則に従って廃棄する。<br><br>成分：消臭剤、抗菌剤、香料<br>使用上の注意：●走行中は使用しない。●ペダル操作の妨げになるため、運転席の下や足元に置かない。●布製品に直接使う際は、シミの原因となる汚れは予め取り除き、目立たない所で試してから使う。●汚れが原因で輪ジミになる場合がある。●故障や変色の恐れがあるので、布製品以外の内装（電気製品、革、人工皮革、プラスチック等）にかけないように注意する。●万一、布製品以外の内装にかかった際は、速やかに布などで拭き取る。●用途以外には使用しない。●吸入飲用不可：人体に害があるので絶対に飲まない。●人体に向かってスプレーしない。●皮フに触れた場合、かぶれる恐れがあるので注意する。●幼児の手の届く所に置かない。応急処置●万一、飲んだ場合は、直ちに医師の診察を受ける。●誤って目に入った場合や皮フに付着した場合は、直ちに流水で１５分以上洗浄し、異常があれば医師の診察を受ける。●使用中気分が悪くなった場合は、直ちに使用を中止し、気分が回復しない場合は、医師の診察を受ける。<br>商品区分：日用雑貨品・他<br>問い合わせ先：エステー株式会社　お客様相談室　〒１６１－８５４０　東京都新宿区下落合１－４－１０　０３（３３６７）２１２０<br>原産国：日本<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
